import {BrowserRouter, Routes, Route} from "react-router-dom";
import LandingPaage from "./LandingPage"

const Router = () => {
    return (
        <BrowserRouter>
                <Route path="/" exact component={LandingPaage}>
                </Route>
        </BrowserRouter>
    )
}

export default Router
